import React from "react";
import { Draggable } from "react-beautiful-dnd";
const Drag = () => {
  return (
    <Draggable
      axis="x"
      handle=".handle"
      defaultPosition={{ x: 0, y: 0 }}
      position={null}
      grid={[25, 25]}
      scale={1}
      onStart={this.handleStart}
      onDrag={this.handleDrag}
      onStop={this.handleStop}
    >
      <div>Drag Me</div>
    </Draggable>
  );
};

export default Drag;
